COPY public.config (key, value, type, display_name, description) FROM stdin;
register:open_transaction_lock_message		text	Locked transaction message	Display this message to the user when a transaction is locked.
register:allow_mergetrans_with_payments	No	boolean	Allow merging transactions with payments	Allow transactions that have payments to be merged into other transactions? Only payment types that are explicitly marked 'mergeable' will be permitted; the presence of payments of other types will still prevent merging.
core:address	Eastnor Castle Deer Park\r\nEastnor HR8 1RQ	multiline text	Site address	Site address to be printed on receipts
core:checkdigit_print	Yes	boolean	Print check digits?	Should check digits be printed on stock labels?
core:currency	£	text	Currency symbol	Currency symbol used throughout the system
core:sitename	EMF 2022	text	Site name	Site name to be printed on receipts
gtk:custom_css	/* This is the file 'custom.css' in the till user's home directory.\n   After updating it, install it using the following command:\n\n   runtill config -s gtk:custom_css <custom.css\n\n   N.B. when you do this, changes made using the web interface will be\n   lost.\n\n   You must restart the till for changes to take effect. If this config\n   option is set to invalid CSS, the till will fail to start.\n */\n\n/* Increase general button font size from 12px */\nbutton {\n    font-size: 16px;\n    text-shadow: none;\n    text-decoration: none;\n    min-height: 60px;\n}\n\n/* Increase number and cursor button font size from 18px */\n.numeric, .cursor, .key2x2, .key2x1, .payment {\n  font-size: 40px;\n}\n\nbutton:not(:active) {\n    transition: 100ms ease-in-out;\n}\n.linekey:active {\n    border-color: white;\n}\n\n.tshirt {\n    background-color: deepskyblue;\n    color: black;\n}\n\n.mate {\n    background-color: lighter(deepskyblue);\n    color: black;\n}\n\n.modifiers {\n  background-color: khaki;\n  color: black;\n}\n\n.modifiers label {\n  text-decoration-line: underline;\n}\n\n.spirits {\n  background-color: orange;\n  color: black;\n}\n\n.soft {\n  background-color: lightseagreen;\n  color: black;\n}\n\n.keg {\n/* Purple wanted */\n/* background-color: sandybrown; */\n  background-color: rgb(198, 63, 175);\n  color: white;\n}\n\n.keghalf {\n  background-color: lighter(rgb(198, 63, 175));\n  color: white;\n}\n\n.ale {\n/* Blue wanted */\n/* background-color: wheat; */\n  background-color: rgb(46, 23, 198);\n  color: white;\n}\n.alehalf {\n    background-color: lighter(rgb(46, 23, 198));\n/* rgb(66, 43, 198);*/\n  color: white;\n}\n\n.cider {\n  background-color: greenyellow;\n  color: black;\n}\n.ciderhalf {\n    background-color: lighter(greenyellow);\n  color: black;\n}\n\n.wine, .winemod {\n/* Brighter pink wanted */\n/* background-color: darksalmon; */\n  background-color: rgb(242, 43, 215);\n  color: black;\n}\n.winemod label {\n  text-decoration-line: underline;\n}\n\n.fridge {\n  background-color: powderblue;\n  color: black;\n}\n\n.snacks {\n/* White-ish wanted */\n/* background-color: coral; */\n  background-color: rgb(240, 242, 232);\n  color: black;\n}\n\n.linekey:active {\n  background-color: black;\n  color: white;\n}	multiline text	Custom CSS	Custom CSS for till when running with gtk
core:telephone	1013	text	Telephone number	Telephone number to be printed on receipts
core:checkdigit_on_usestock	No	boolean	Require check digits?	Should check digits be enforced when putting stock on sale?
register:open_transaction_warn_after	10 days	interval	Warn about open transactions after	When recalling an open transaction, warn the user if it is older than this.  If blank, never warn.
register:open_transaction_lock_after	20 days	interval	Lock open transactions after	Prohibit adding lines to an open transaction when it is older than this.  If blank, never lock.
register:max_transline_modify_age	2 minutes	interval	Transaction line modify-in-place age limit	For how long after it is created can a transaction line be modified?  This applies both to adding additional items and voiding the line.
